import react from 'react'
import ListGroup from 'react-bootstrap/ListGroup';
const Menus=()=>{
    return(
<ListGroup variant="flush">
      <ListGroup.Item>No style</ListGroup.Item>
      <ListGroup.Item variant="primary">Home</ListGroup.Item>
      <ListGroup.Item variant="success">Add  Course</ListGroup.Item>
      <ListGroup.Item variant="warning">View Courses</ListGroup.Item>
      <ListGroup.Item variant="info">About</ListGroup.Item>
      <ListGroup.Item variant="danger"> Contact</ListGroup.Item>
    </ListGroup>
    );
};
export default Menus;
